import React from "react";
import { BrowserRouter, Route } from "react-router-dom";

const Nav = () => {
  return (
    <div className="navbar">
      <div className="container">
        <a href="#" className="logo">
          logo
        </a>
        <ul>
          <a href="/">Home</a>
          <a href="/about">About</a>
        </ul>
      </div>
    </div>
  );
};

export default Nav;
